package day9;
import java.util.*;

public class RangeOfSoldierNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		System.out.println("enter the range i.e. start and end number");
		int start=sc.nextInt();
		int end=sc.nextInt();
		int i;
		System.out.println("selected numbers are : ");
		for(i=start;i<=end;i++)
			System.out.println(i);
			
	}

}
